import { connect } from 'react-redux';
import styles from './Favorites.module.css'


const Favorites = (props) => {
    console.log(props);
    return(
        <div>
            <div>
                <select name="" id="">
                    <option value="order" disabled="disabled">Order By</option>
                    <option value="Ascendente">Ascendente</option>
                    <option value="Descendente">Descendente</option>
                </select>
                <select name="" id="">
                    <option value="filter" disabled="disabled">Order By</option>
                    <option value="Male">Male</option>
                    <option value="Female">Female</option>
                    <option value="Genderless">Genderless</option>
                    <option value="unknown">unknown</option>
                </select>
            </div>
            <h2>My Favorites</h2>
            <div className={styles.contenedor}>
                {   
                    props.myFavorites?.map((personaje) => (
                            <div className={styles.personaje}>
                                <h2>Nombre: {personaje.name}</h2>
                                <img  src={personaje.image} alt="imagen principal" />
                                <h2>Specie: {personaje.species}</h2>
                                <h2>Gender: {personaje.gender}</h2>
                            </div>
                        ))
                }
            </div>
        </div>
    );
}

export const mapStateToProps = (state) => {
    return{
        myFavorites: state.myFavorites
    }
}

export default connect(mapStateToProps, null)(Favorites);
